import React, {useState} from 'react';
import {useNavigate} from 'react-router-dom';
import axios from 'axios';
function OfficerSignup() {
    const [officer, setOfficer] = useState({
        uniqueId: '',
        email: '',
        password: ''
      });
      const [error, setError] = useState('');
      const navigate = useNavigate();
    
      const handleChange = (e) => {
        setOfficer({
          ...officer,
          [e.target.name]: e.target.value
        });
      };
    
      const handleSubmit = async (e) => {
        e.preventDefault();
        try {
          const response = await axios.post('/api/officers/register', officer);
          if (response.data.success) {
            navigate('/login');
          } else {
            setError('Registration failed');
          }
        } catch (error) {
          setError('Error in registration');
        }
      };
    
      return (
        <div className="signup-container">
          <h2>Officer Signup</h2>
          <form onSubmit={handleSubmit}>
            <label>
              Unique ID:
              <input type="text" name="uniqueId" onChange={handleChange} required />
            </label>
            <label>
              Email:
              <input type="email" name="email" onChange={handleChange} required />
            </label>
            <label>
              Password:
              <input type="password" name="password" onChange={handleChange} required />
            </label>
            <button type="submit">Signup</button>
            {error && <p className="error">{error}</p>}
          </form>
        </div>
      );
};
export default OfficerSignup;
